import React from 'react'

export default function Character(props) {
  props = props.props
  return(
    <div class="character main">
      <img src="" alt={`${props.name} Portrait`} class="portrait"/>
      <div>{props.name}</div>
      <div>{props.initiative}</div>
    </div>
  )
}
